// Application1.js
import React from 'react';
import {
  Typography, Table, TableHead, TableRow, TableCell,
  TableBody, Grid, Box
} from '@mui/material';

const Application1 = ({ data, config }) => {
  if (!data) return null;

  return (
    <Box sx={{ mt: 5 }}>
      <Typography variant="h6" gutterBottom>
        Application Preview
      </Typography>

      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Subject</TableCell>
            {config.subjects[0].fields.map((field) => (
              <TableCell key={field.key}>{field.label}</TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {config.subjects.map((subject) => (
            <TableRow key={subject.key}>
              <TableCell>{subject.label}</TableCell>
              {subject.fields.map((field) => (
                <TableCell key={field.key}>
                  {data[subject.key]?.[field.key]}
                </TableCell>
              ))}
            </TableRow>
          ))}
        </TableBody>
      </Table>

      <Grid container spacing={2} sx={{ mt: 3 }}>
        {config.extraFields.map((field) => (
          <Grid item xs={3} key={field.key}>
            <Typography>
              <strong>{field.label}:</strong> {data[field.key]}
            </Typography>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default Application1;
